import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import fullundividedpage from './components/fullundividedpage';

import PortfolioCard from './components/PortfolioCard';

function App() {
  return (
    <main style={{
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "flex-start",
      minHeight: "100vh",
      padding: "2rem",
      backgroundColor: "#f5f5f5"
    }}>
      <h1>Veronica's Portfolio</h1>
      <div style={{
        display: "flex",
        flexWrap: "wrap",
        gap: "1rem",
        justifyContent: "center"
      }}>
        <PortfolioCard 
          title="Project One" 
          description="This is a short description of my first project." 
          link="https://github.com/VeronicaSj/PRE_Portfolio" 
        />
        <PortfolioCard 
          title="Project Two" 
          description="Another cool project I built using React." 
          link="https://github.com/VeronicaSj/PRE_Portfolio" 
        />
      </div>
    </main>
  );
}

export default App;
